import { useDispatch, useSelector } from "react-redux";
import {
  fetchReposAction,
  fetchProfileAction,
} from "./redux/slices/reposSlice";
import { useEffect } from "react";
function App() {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(fetchReposAction("tweneboah"));
    dispatch(fetchProfileAction("tweneboah"));
  }, []);
  return (
    <div class="h-100 d-flex justify-content-center align-items-center">
      <h3 class="badge bg-primary">Flex item 1</h3>
      <h3 class="badge bg-primary">Flex item 2</h3>
      <h3 class="badge bg-primary">Flex item 3</h3>
    </div>
  );
}

export default App;
